import React, { Component } from 'react'
import UserMessage from './UserMessage'

export class NestingComponents extends Component {
    constructor(props) {
      super(props)

      this.state = {
         isLoaded: true,
         isLoggedIn: true
      }
    }

    render() {
        return (
            <div>
                <h1>{this.state.isLoaded ? 'Data Loaded' : 'Loading...'}</h1>
                <UserMessage />
            </div>
        )
    }
}

export default NestingComponents
